import React, { Component } from 'react';
import './App.css';

class App extends Component{
  constructor(props){
    super(props)
    this.state = {
      monsters:[]
    }
  }
  componentDidMount() {
    fetch('http://jsonplaceholder.typicode.com/users')
    .then(res => res.json())
    .then(monsters => this.setState({
      monsters
    }))
  }

  render(){
    return(
      <div>
        {
          this.state.monsters.map(monster => <h1>{monster.name}</h1>)
        }
      </div>
    )
  }

}

export default App;
